import React from "react";
import "./Card.css";

const Card = (props)=>{
    return(
        <>
            <div className="container">
                <h3 style={{textAlign:"center"}}>Item no : </h3>
                {/* <image src={'https://avatars.githubusercontent.com/u/92628257?v=4'} alt="alt" height="100px" width="100px"/> */}
                <p>Name : {props.login}</p>
                <p>URL: {}</p>
            </div>
        </>
    );
}

export default Card;
